import React from 'react';
import { Heading } from '../components/Heading';

const Home: React.FC = () => (
  <>
    <Heading name="Home" description="Welcome to the Car4Sure dashboard. View your summary and quick links here." />
    <div className="p-4">Home Page</div>
  </>
);

export default Home;
